getChartR :: CompanyId -> Handler Value
getChartR companyId = do
  let chart = buildForest accountChart
  return $ object ["chart" .= chart]
  

data ReportItem
  = ReportItemAccount {id:: Int, label :: Text, tab :: Int, amount :: Double, account :: Int}
  | ReportItemHeader {id:: Int, label :: Text, tab :: Int}
  deriving (Generic, Show)
instance FromJSON ReportItem where
  parseJSON = genericParseJSON defaultOptions{sumEncoding = UntaggedValue, fieldLabelModifier = camel}

instance ToJSON ReportItem where
  toJSON = genericToJSON defaultOptions{sumEncoding = UntaggedValue, fieldLabelModifier = camel}

data ReportTree a = ReportNode {value :: a, children :: [ReportTree a]}
  deriving (Show, Generic, FromJSON, ToJSON, Foldable)


sumAll :: ReportTree ReportItem -> Double
sumAll tree = do
    let list = Data.Foldable.toList tree 
    Data.Foldable.foldr (\item acc->case item of 
          ReportItemAccount{amount} ->acc+amount
          ReportItemHeader {} -> acc
  
      ) 0 list


