buildForest :: [ReportItemInput a] -> [ReportTree a]
buildForest items = Data.List.map (buildTreeFrom items) . filter (isNothing . parentId) $ items
 where
  buildTreeFrom items (Item i _ v) =
    ReportNode{value = v, children = Data.List.map (buildTreeFrom items) . filter ((== Just i) . parentId) $ items}
    
data ReportItemInput a = Item
